import{_ as e,c as t,o as a,a as o}from"./app.b9792699.js";const m=JSON.parse('{"title":"\uC624\uB298\uC758 \uAE30\uB85D","description":"","frontmatter":{"title":"\uC624\uB298\uC758 \uAE30\uB85D","createBy":"2022-09-15T00:00:00.000Z"},"headers":[],"relativePath":"TIL/202209/20220918.md"}'),r={name:"TIL/202209/20220918.md"},s=o('<br><h2 style="font-size:26px;color:black;">\uC624\uB298\uC758 \uC774\uC57C\uAE30\u{1F9E7}</h2><hr><p>\uC624\uB298\uC740 \uC544\uBE60\uB791 \uC544\uCE68\uBD80\uD130 \uB370\uC774\uD2B8\uB97C \uD588\uB2F9! \uC6B0\uB9AC\uC9D1 \uADFC\uCC98\uC5D0\uB294 \uB300\uD615 \uCE74\uD398\uB4E4\uC774 \uBB34\uC9C0\uD558\uAC8C \uB9CE\uC740\uB370 \uADF8\uC911\uC5D0\uC11C\uB3C4 \uC544\uC8FC.. \uC790\uC8FC\uAC00\uB294,. \uCE74\uD398\uC5D0 \uAC14\uB2E4. \uC5ED\uC2DC\u3163 \uB108\uBB34 \uBE75\uC740 \uB9DB\uC788\uB2E4. \uC544\uBE60\uB791 \uCE74\uD398\uC5D0\uC11C \uC694\uB807\uACE0 \uC800\uB7F0 \uC774\uC57C\uAE30\uB97C \uD588\uB2E4 \uC544\uBE60\uAC00 \uC624\uB79C\uB9CC\uC5D0 \uB098\uB791 \uB370\uC774\uD2B8 \uD574\uC11C \uC88B\uB2E4\uACE0 \uADF8\uB7AC\uB2F9\u314E \uC9D1\uC5D0 \uAC00\uB294\uAE38\uC774 \uC544\uC26C\uC6CC \uADFC\uCC98\uC5D0 \uC788\uB294 \uACE8\uD504\uC7A5\uC5D0 \uB4E4\uB7EC\uC11C \uB4DC\uB77C\uC774\uBE0C\uB97C \uD558\uAD6C \uC7A5\uC744 \uBCF4\uACE0 \uAC14\uB2E4! \uAC00\uB294\uAE38\uC5D0 \uAC11\uC790\uAE30 \uC5B8\uB2C8 \uB370\uB9B4\uB7EC \uAC00\uC790\uAD6C \uC774\uB300\uB85C \uAC00\uAE30 \uC544\uC27D\uB2E4\uACE0 \u314E\u314E \uB531 \uB0B4 \uB9C8\uC74C\uC744 \uC77D\uC5B4\uBC84\uB838\uB2E4! \uADF8\uB798\uC11C \uC5B8\uB2C8\uB97C \uD53D\uC5C5\uD558\uAD6C \uC9D1\uC73C\uB85C \uAC14\uB2E4. \uC9D1\uC5D0\uC11C \uB0B4\uAC00 \uC624\uB79C\uB9CC\uC5D0 \uC544\uBE60\uC758 \uAC74\uAC15\uC744 \uC704\uD574 \uC0D0\uB7EC\uB4DC\uB97C \uB9CC\uB4E4\uC5B4\uC92C\uB2E4. \uBA39\uC73C\uBA74\uC11C \uC6B0\uB9AC \uC14B\uC740 \uC694\uC998 \uADFC\uD669\uC5D0 \uB300\uD574 \uC598\uAE30 \uD588\uB2E4. \uB531 \uC9C0\uAE08 \uC774 \uC2DC\uAE30 \uC6B0\uB9AC \uAC00\uC871\uC774 \uBAA8\uB450 \uC798 \uB418\uC5B4\uAC00\uB294 \uC2DC\uAE30 \uC778\uAC70 \uAC19\uB2E4. \uC544\uBE60\uB294 \uC0C8\uB85C\uC6B4 \uD604\uC7A5\uC744 \uD560 \uC218 \uC788\uB294 \uAE30\uD68C\uB97C \uC5BB\uC5B4.. \uC9C0\uAE08\uC758 6\uBC30\uC758 \uC2DD\uC218 \uC778\uC6D0\uC774 \uC62C\uC218 \uC788\uB294 \uC88B\uC740 \uC18C\uC2DD\uC744 \uC804\uD588\uACE0, \uC5B8\uB2C8\uB294 \uC774\uC9C1\uD55C \uD68C\uC0AC\uC5D0\uC11C \uBC30\uC6B8\uC810\uC774 \uB9CE\uACE0, \uB9CE\uC740 \uAE30\uD68C\uB97C \uC8FC\uC2DC\uB294 \uB300\uD45C\uB2D8\uC744 \uB9CC\uB098 \uC544\uC8FC \uC798\uD558\uACE0 \uD558\uACE0 \uC788\uB294\uAC70 \uAC19\uC544 \uBA4B\uC788\uC5C8\uB2E4! \uB098\uB3C4 \uC880\uB354 \uBD84\uBC1C\uD574\uC57C\uACA0\uB2E4\uB294 \uC0DD\uAC01\uC744 \uD588\uB2E4. \uC5B8\uC820\uAC00\uB294 \uB0B4\uAC00 \uC544\uBE60\uC758 \uCC28\uB97C \uD3EC\uB974\uC250\uB85C \uBC14\uAFC0 \uC218 \uC788\uB294 \uB0A0\uC774 \uC624\uAE30\uB974\uB97C... \u314E \uCA43\uB4E0! \uC624\uC21C\uB3C4\uC21C \uC598\uAE30\uB97C \uD558\uACE0 \uB098\uB294 \uC624\uD6C42\uC2DC\uCBE4 \uC900\uC11C\uB97C \uB9CC\uB098\uB7EC \uC6A9\uC0B0 \uC544\uC774\uD30C\uD06C\uC5D0 \uAC14\uB2E4. \uAC00\uC11C \uC601\uD654\uB3C4 \uBCF4\uACE0~ \uB9C8\uB77C\uD0D5\uB3C4 \uBA39\uC5C8\uB2E4! \uC900\uC11C\uB97C \uBABB\uBCFC\uC904 \uC54C\uACE0 \uAD49\uC7A5\uD788.. \uC544\uC26C\uC6E0\uC9C0\uB9CC! \uB2E4\uD589\uC774 \uB9CC\uB0A0 \uC218 \uC788\uC5B4 \uC88B\uC558\uB2F9 \u314E\u314E \uC870\uAE08 \uAD49\uC7A5\uD788 \uAC70\uB9AC\uAC00 \uBA40\uAE34\uD558\uC9C0\uB9CC \uADF8\uB798\uB450 \uC88B\uB2F9 \u{1F913}</p><h4 id="" tabindex="-1"><a class="header-anchor" href="#" aria-hidden="true">#</a></h4><h2 style="font-size:26px;color:black;">\uC624\uB298 \uACF5\uBD80\uD55C \uB0B4\uC6A9 \u{1F4CB}</h2><hr><ul><li>vmware \uC124\uCE58</li><li>\uBC31\uC5D4\uB4DC \uAC1C\uB150 \uB178\uC158\uC5D0 \uC815\uB9AC\uD558\uAE30</li><li>\uD488\uC2DD \uD504\uB85C\uC81D\uD2B8 \uACC4\uD68D\uC11C \uB178\uC158\uC5D0 \uC815\uB9AC\uD558\uAE30</li></ul><h2 style="font-size:26px;color:black;">\uC5B4\uB824\uC6E0\uB358 \uB0B4\uC6A9 \u{1F922}</h2><hr><h2 style="font-size:26px;color:black;">\uAD81\uAE08\uD55C \uB0B4\uC6A9 / \uBD80\uC871\uD55C \uB0B4\uC6A9 \u{1F9D0}</h2><hr>',12),c=[s];function l(_,i,n,h,d,p){return a(),t("div",null,c)}const T=e(r,[["render",l]]);export{m as __pageData,T as default};
